import React from 'react'
import Layout from '../components/Layout'
import { MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText, MDBTooltip, MDBCardFooter, MDBBtn, MDBIcon} from "mdbreact";

function ProductList() {
  return (

    <Layout>
     <article className="card">
        <CardHeader image={'https://source.unsplash.com/user/erondu/600x400'}/>
        <CardBody title={'What happened in Thialand?'} text={'Kayaks crowd Three Sister Springs, where people and manatees maintain controversial coexistence'}/>
      </article>
    )
  

  </Layout>
);

  }

export default ProductList
